export default function BasicModal(props) {

  const [query, setq] = React.useState({q:'',
                                    doms:'',
                                    from:'',
                                to:'',
                                 lang:''});


  console.log(props,"state")

  const handleClose = () => props.setOpen(false);
  const handleChange = e => {
    const {name , value} = e.target;
    const newQuery = {...query};
    console.log(newQuery,"1")
    newQuery[name]=value
    setq(newQuery)
}
 console.log(query)
  return (
    <div>

      <Modal
        open={props.open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style}>
        <Typography  id="modal-modal-title" variant="h6" component="h2">
          Enter Filter parameters
          </Typography>
          <br/>
        <TextField fullWidth label="Search by Title/Desc"   value={query.q} name="q" onChange={(e)=>handleChange(e)} variant="outlined" />
        <br/> <br/>
        <TextField fullWidth label="Enter comma seperated domain names"    value={query.doms} name="doms" onChange={e=>handleChange(e)} variant="outlined" />
      <br/> <br/>
        <TextField
        fullWidth
        id="date"
        label="From"
        type="date"
        // defaultValue="2017-05-24"
        // className={classes.textField}
        InputLabelProps={{
          shrink: true,
        }}
        onChange={e=>handleChange(e)}
        name="from"
        variant="outlined"
      />
      <br/>
      <br/>
          <TextField
        fullWidth
        id="date"
        label="To"
        type="date"

        InputLabelProps={{
          shrink: true,
        }}
        onChange={e=>handleChange(e)}
